def getHeader(stats):
    """Returns a header for the final output HTML file. The stats variable defines the content to the right of the "DP ATTACK STORY" logo"""
    header=f"""\
<html>
  <head>
    <script type="text/javascript" src="https://www.gstatic.com/charts/loader.js">
    google.charts.load('current', {{'packages':['corechart', 'annotationchart']}});
    </script>
    <title>DP Attack Story</title>
    {getCSS()}
  </head>
  <body>
    <table>
      <tr>
        <td width="50%" style="text-align: center; border: none;">{logo()}</td>
        <td width="50%" style="border: none;">
{stats}  
      </td>
      </tr>
    </table>"""
    return header

def getCSS():
    """Returns CSS to be included in the header."""

    return """<style>
        * {
            font-family: Arial, sans-serif;
        }
        table {
            width: 100%;
            border-collapse: collapse;
            margin-bottom: 20px;
        }
        th, td {
            border: 1px solid black;
            padding: 8px;
            text-align: left;
        }
        th {
            background-color: #f2f2f2;
            text-align: center;
        }
        h2 {
            line-height: 1.5; 
            text-align: center;
        }
        pre {
            white-space: pre-wrap; /* Wraps long text and preserves formatting */
        }
        .above-threshold {
            background-color: #ffcccc;
        }
        .collapsible {
            background-color: #777;
            color: white;
            cursor: pointer;
            padding: 5px;
            width: 100%;
            border: none;
            text-align: center;
            margin: 4px 2px;
            outline: none;
            font-size: 15px;
            text-align: center;
            transition: background-color 0.3s, transform 0.2s;
        }
        .active, .collapsible:hover {
            background-color: #555;
        }
        .content {
            padding: 0 18px;
            display: none;
            overflow: hidden;
            background-color: #f9f9f9;
        }
        .copy-button {
            background-color: #f2f2f2;
            color: black;
            border: None;
            padding: 5px;
            cursor: pointer;
            font-size: 12px;
            font-weight: bold;
            margin-left: 5px;
        }
    </style>"""

def logo():
    """Returns an embedded base64 encoded version of logo.jpg"""
    return '<img src="data:image/jpeg;base64," alt="logo" />'
